import Card1 from './assets/image1.png'
import Card2 from './assets/wedding-photography.png'
import { FaStar } from "react-icons/fa";
import data from './data.js';



  function Card(props) {
      return (
          <div className='card-component shadow-lg p-4 rounded mx-3 my-5'>
                <span className='soldout-text px-2 m-3'>{props.available}</span>
                <img src={props.img} className='card-image shadow-lg'></img>
                <span><FaStar className='star'/>{props.rating} {props.location}</span>
                <br></br>
                <span>{props.title}</span>
                <br></br>
                <span><b>From {props.price}$</b> / person</span>
            </div>
    )
}

function CardList(){
    let mapped_data = data.map((x) => {
        return <Card location={x['location']} img={x['coverImg']} title={x['title']} price={x['price']} available="SoldOut" /> 
    })

    return(
        <div>
            <Card />
        </div>
    )
}

export {CardList};
